import React from "react";
import background from "../assets/background.jpg";

const Hero: React.FC = () => {
  return (
    <section
      className="min-h-screen bg-no-repeat bg-cover bg-center flex items-center justify-center text-white"
      style={{
        backgroundImage: `url(${background})`,
      }}
    >
      <div className="bg-black bg-opacity-50 p-10 rounded-lg text-center max-w-xl">
        <h1 className="text-5xl font-bold mb-6">Welcome to Shwe Digit</h1>
        <p className="text-lg mb-4">
          We provide innovative IT solutions to empower your business.
        </p>
        <button className="mt-4 px-6 py-3 bg-blue-600 hover:bg-blue-700 transition rounded text-white font-semibold">
          Get Started
        </button>
      </div>
    </section>
  );
};

export default Hero;
